do nível de água;
O porta-filtro é removível e lavável! 
E acompanha colher dosadora para ajudar na medida exata do café; 
O café de todos os dias está melhor, preparado com muito carinho por
você e com o auxílio da incrível Cafeteira Elétrica CP38 Thermo
Inox Britânia!

